class Solution {
public:
	int edgeScore(vector<int>& edges) {
		long long l = edges.size();
		unordered_map<long long, long long> um;

		for (int i = 0; i < l; ++i) {
			um[edges[i]] += i;
		}

		long long max_idx = -1, max_val = -1;
		for (auto it : um) {
			if (it.second > max_val) {
				max_idx = it.first;
				max_val = it.second;
			}
			else if (it.second == max_val) {
				if (it.first < max_idx) {
					max_idx = it.first;
					max_val = it.second;
				}
			}
		}

		return max_idx;
	}
};

